  _BLUEPRINTS.INV_ITEMS.codec_a4 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Alexander Wang] [Year: 4075]\r\nHave I become a Tyrant? Is what Asuna says really true? I must resist letting her into my head. I\'m a leader, I make decisions and I keep to them. Through thick and thin. She doesn\'t understand.\r\n\r\nI feel even Ira, someone I used to see as a mother figure now resents me for making her stay when Kenshin travelled North. But still I must remain composed. Kenshin may have survived for now but the lands will take him soon without SinCorps help.\r\n\r\nThere isn\'t some book called \'How to deal with failing clones and rebelling staff for dummies\'. Pf, I bet I could write it, number 1 best seller on the outworlds. Frack, what is this mess.\r\n\r\nFor now Ira is continuing her research into the clone failings, and Bob as useful as he is keeps her coming in to the lab every day with his energy and bad uncle jokes. I like Bob, he\'s a bit less scientific than you would expect a scientist to be, but hey, everyone likes Bob!\r\n\r\nI\'ve had to increase the security around Landzo, implementing more heavy handed tactics with the units on the ground. It\'s harsh but we need this control after all the recent bandit attacks and the sighting of Lokals nearby.'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: Am I a tyrant?'
  };
  _BLUEPRINTS.INV_ITEMS.codec_a5 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Masha Lyuda] [Year: 4055]\r\nHa, living for 100\'s of years. What a bunch of self centered tossers. Could you imagine how selfish you\'d have to be to live almost 1000 years? How much you\'re stealing from nature, and others opportunities. This is what SinCorp stands for, this is what it sells.\r\n\r\nSinCorp holds no value to human life and just see\'s a price tag. Extending the life of the rich and bringing clones into existence without even a real family, wage or life, just to serve the highest bidder. Fracking disgusting.\r\n\r\nClones are living things too, with brains, emotions, capabilities the same as a human... Apart from reproduction and fully formed free choice. Who the frack made that choice? Imagine being trapped in your own body!\r\n\r\nToday I\'m making the choice to leave all of this behind. This corporate run life of control and tyranny. I can\'t wait to be free. I have seen more and more clones getting past the gates every day. I will find them. I will help.'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: Just die already!'
  };
  _BLUEPRINTS.INV_ITEMS.codec_a6 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Ira Barber] [Year: 4079]\r\nSpirits give me strength. My body is growing weaker by the day and SinCorp isn\'t supporting Ruoni or myself. I\'ve thought about making the journey north but I\'m afraid I\'m too old to survive the journey now.\r\n\r\nI regret not following Kenshin all those years ago, I should have followed my gut and not listened to Alex. Why do I always make these mistakes?\r\n\r\nI don\'t think it\'s too late for Ruoni to make the journey north. All we need is a map or a guide, that would do it. I pray every night for an angel to help.'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: Just die already!'
  };
  _BLUEPRINTS.INV_ITEMS.codec_a7 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Bob How] [Year: 4020]\r\nI\'ve made a huge mistake. A mistake I will have to take to my grave. I don\'t know how I manage to live everyday with this fake smile and cracking such good jokes. I even impress myself sometimes.\r\n\r\nThe guilt of my mistake is too heavy and so I\'m going to write my admission in the hopes of alleviating this weight on my chest. After all, got another day in the lab tomorrow. Oof with dreamy Ira. She\'s showing her age now but I\'d stil enjoy a night on the chems with her, bet she would take \'em too.\r\n\r\nBah! Where to start, many years ago during the voyage to the new colony I was working late in the lab making chems, yknow - the usual, some PrepMeUp, DropMeDown and all that. Everything was going well and no one was around so I could make all the noise I wanted and get away with it.\r\n\r\nI guess I got a bit carried away and took the PrepMeUp before it had cooled down fully, and boooyyyyooo woooh! Never felt a hit so hard in my life. Before I knew what was going on I was swinging widly around the lab with insane strength.\r\n\r\nI blacked out and when I came to I was on the floor of the lab surrounded in PrepMeUp juice and a warning siren for the clone sequencer. My heart sank instantly I knew I must have done something during my intoxicated rage.\r\n\r\nI looked on the diagnostics screen and almost puked, all this way into space, only a few survivors and one goal to colonise a planet with clones. The screen reads... ... All DNA Sequences corrupted.\r\n\r\nGiven that we lost communication with earth 20 years ago, the only way to rectify the issue was a complete resequence, which on our best computers would take over a thousand years, or turn back to earth. We\'re already 50 years into this trip where many of the people on board have sacrificed those years to make this journey. Can I really be reponsible for all those lost years? Infact - another 50 years lost on the return? I CAN\'T BARE THE THOUGHT!'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: My grave mistake'
  };
  _BLUEPRINTS.INV_ITEMS.codec_a8 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Ruoni Barber] [Year: 4020]\r\nI\'m sat here again... Asking myself... Why do I even exist... What\'s the point? You could just make a clone, you could just clone someone you know. Why was I even born?\r\n\r\nMaybe if I knew my father I\'d understand everything better, or atleast feel I have a reason to live. But I just don\'t I don\'t understand why I\'m here, what my purpose is.\r\n\r\nMothers getting old now and has become almost completely resistant to ExtendYoLife she still has plenty of energy and is still extremely capable, but her body is just so weak that extended working or travelling really exhausts her.\r\n\r\nSometimes I wonder if I should go North and look for my father... but I don\'t think I should leave Mother just yet...'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: Whats the point?'
  };
  _BLUEPRINTS.INV_ITEMS.codec_resources = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Bob How] [Year: 4001]\r\nSo I suppose it\'s not all doom and gloom here. It looks like the trees and plants here at least offer something in the way of resources.\r\nJust setting a few clones on the trees for an hour yielded huge stacks of wood for us to use in manufacturing.\r\nThe plants work great as a fiber material too. It\'s surprising how well it performs when compare to Earthly materials.'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: Resources'
  };
  _BLUEPRINTS.INV_ITEMS.codec_a1 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Asuna Yamai] [Year: 4075]\r\nIt\'s so fascinating. Earth. The blue marble. Phhwar. I had another dream about it last night. I was falling from space towards the planet. I could see the trees flying past me. And then a huge waterfall. I dived towards it and into the ocean.\r\nI took a deep breathe under the water and could breathe cleaner air than I had ever before. It was so refreshing. This was Earth, mother. I knew her; yet without meeting her. I hugged her and wished I could stay. And then the inevitable. I wake up to this desert. This dusty horrible crap filled bunker surrounded by weird looking clones and people I barely know.\r\nMy teacher Dr .Kenshin Yamakai left long ago, he inspired me to research Earth and told me all the different stories of him and his first family living in the Japanese countryside. I miss his stories often, and wonder if I will ever get to hear another one again.\r\nIf only the long range comms was working, I could be in touch with Dr. Yamakai, Earth, Masha and the rest of the galaxy. We wouldn\'t be alone anymore. Who knows, I might even be able to arrange a taxi back to Earth!\r\nNow that Masha has left Landzo and Dad\'s become a controlling a-hole. I wonder why I should stay here... There\'s nothing here for me. Sure, I\'ll miss Ruoni but he\'s got his mother to look after.\r\n\r\n\r\n'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: The Pale Blue Dot'
  };
  _BLUEPRINTS.INV_ITEMS.codec_a2 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Kenshin Yamakai] [Year: 4075]\r\nAgainst my duties, it is with no great ease that today I say farewell to so many founders whom I love and care for. But it\'s too much. The corruption within the corp has gone too far; the failed clones piling up. The failed eco projects. No more. A few founders have chosen to follow me north and set up a new research base. Maybe this new beginning is just what this planet needs.\r\n\r\n\r\n'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: The gentle river flows'
  };
  _BLUEPRINTS.INV_ITEMS.codec_a3 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Seb Fou] [Year: 4060]\r\n200 years. 200 Fricken years. I\'ve been alive for this long and still have to suffer the ignorance of my peers.\r\n\r\nBob How has really messed up this time, through every single calculation I\'ve made it will be irreversible to correct the issues with our clones without some form of scientific breakthrough.\r\n\r\nI\'ve been collecting local flora and fauna to see if it has any uses in the lab and I tried eating a few just out of curiosity... I know, it\'s a bad idea - and even worse I\'m starting to feel the side effects.\r\n\r\nBut, with my own illness and Bobs eternal incompetence; I must continue in my work, I must find a solution to the cloning problems, otherwise given how hostile this planet is, we\'re all doomed.\r\n\r\nIt is for this reason I have taken it upon myself to leave this wretched colony and begin more drastic experiments on my own\r\n\r\nI\'ve stolen a remote science outpost and plan to make my way to the east. I\'ll begin my experiments in private and once I\'ve figured it out I\'ll return the hero.\r\n\r\n'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: The Collector'
  };
  _BLUEPRINTS.INV_ITEMS.codec_b = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: The Bookmaker] [Year: 4080]\r\n\r\nIf I don\'t write this down somewhere I\'m going to forget! Before I start writing my complete codec history of the colony I will establish the timeline I want to write about.\t\t\r\n\t\t\r\n[3750]\r\nThe galaxy is no longer an unreachable void, now it is a playground for mankind. Humans have been mining asteroids and colonizing closeby planets for the last 500 years\r\nThe earth is made up of 3 leading nations, The Anglotets from the west, The Sinojese from the east and The Independants\r\nEarth is mostly a peaceful place, with wars only taking place between private organisations across the solar system over planet claims.\r\nSinCorp is the largest company in the solar system, making its profits from life extending drugs such as ExtendYoLyf.\r\nThrough a battle of the balance books SinCorp became the global dominant force of Earth and it ensures the 3 nations co-operation and encourages diversity across its people, and it\'s products.\r\n\r\n[3800]\r\nCloning humans is perfected by SinCorp when they develop a formula based on ExtendYoLife called Mulch, which is used to create the clones. They announce plans to begin a mass colonization effort across the galaxy using this new technology.\r\n\r\n[3805]\r\nJust 5 years after perfecting cloning technology, the corp sent out over a thousand colony ships far into space stocked up with ExtendYoLyf and humans known as \'Founders\' from the 3 leading nations with the technology to create servient clones.\r\n\r\n[3900]\r\nThe Zhuding-7 colony ship, 100 years into its 200 light-year trip, experiences a loss of ship captain AI and communication with earth due to dark-space corruption.\r\nAlexander Wang, who was born during the trip, son of one of the founders steps up to calm the crew and arrange for a manual intervention on the ships controls\r\nWang is successful in bringing the ship into manual control and decides to continue towards the targeted planet. This show of leadership earn his the nickname \'Captain\'.\r\n\r\n[4000]\r\nThe Zhuding-7 colony ship lands on its targeted planet. The atmosphere is breathable but the land appears barren and devoid of life\r\n\r\n[4010]\r\nWithin 10 years of colonising the first 100 clones are created, several of the clones failed to be created fully but the remaining clones begin work on eco projects to make food supplies sustainable\r\n\r\n[4050]\r\nThe colony has began to grow its clone production but for every clone created, a failed clone is thrown away. The clone failing issue is never addressed\r\n\r\n[4052]\r\nWith growing tensions, and the acts of a few failed clones, more clones begin defecting and leaving the corp, resulting in bandit camps near the landing zone which at this point is a minor clone-city, nicknamed \'Landzo\'\r\n\t\t\r\n[4060]\r\nMany of the eco projects are failing and food supplies in the colony begin to dwindle. Most clones and even the founders are left to eating Mulch, the formula to create clones.\r\n\r\n[4075]\r\nFollowing concerns with the corps lack of diligence and its corruption, a founder named Kenshin Yamakai defects and sets up a new eco research station in the north east.\r\nAsuna Li, the daughter of Captain Wang later joins Kenshin Yamakai in hopes to also develop a way to communicate with Earth. An obsession she has had since hearing stories about it during her childhood.\r\n\r\n[4078]\r\nYamakai\'s followers are successfuful in creating their own little eden on the planet, but Asuna\'s requests for more efforts in communicating with earth go ignored.\r\n\r\n[4080]\r\nAsuna Li leaves the Yamakai after attempts to divert research efforts from Eco projects to Comms projects fail, she takes with her, stolen cloning technology and two clones for protection\r\nAsuna sets up a research camp to the west and begins producing clones for her communication efforts\r\nThe camp regularly steals from SinCorp and has been dubbed The Dusters by SinCorp. All Dusters are wanted by SinCorp for crimes of stealing technology'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: Colony Timeline'
  };
  _BLUEPRINTS.INV_ITEMS.codec_b1 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: The Bookmaker] [Year: 4080]\r\nSo here we find ourselves, on a desert planet with low supplies; failing technology and local aliens who kill us on sight. How did I end up here? I thought I\'d find adventure, friends and maybe more!\r\n\r\nOh well, I\'ve gone long enough without a decents night sleep to know this isn\'t going to end well. Worse yet I can see the clone population growing while the human population is declining, this means eventually there must be no humans left! Imagine that! Would this even be a human colonized planet anymore? Or just some new civilization of bizarre mutated clones? A nightmare I\'ve seen many times.\r\n\r\nIf I can\'t have my own adventures and humanity here is doomed, I might aswell begin to preserve the history of my time; so that clones and other cultures can learn from how this civilization began.'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: Someone has to do it'
  };
  _BLUEPRINTS.INV_ITEMS.codec_b2 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: The Bookmaker] [Year: 4080]\r\n200 years. 200 years cramped and aggitated in a smelly aired space can. That\'s how my misadventure among the stars begins.\r\n\r\nAround the year 2800 the Sincorp Corporation began sending out colony ships to distant planets with the technology of cloning and creating a new colony. Why? I\'ll tell you WHY! PROFITS. That\'s it! Send 1000 space ships out to the nearest "habitable" planets and you\'re the first one there. Doesn\'t even matter if 999 of them are useless if you got that one great one. Man, I really wish I figured this out before getting on that ship.\r\n\r\nThe reason I got on the Zhuding-7 colony ship along with all the other founders was the allure of adventure. I wanted to come here, I wanted to seek new frontiers. On the day of boarding I didn\'t feel that way. I felt like it was some form of road trip for a bunch of normy humans who would support their life through a mixture of ExtendYoLyf agents, partying and cryosleep to shake off the hangovers.\r\n\r\nAnd I was right... That sinking feeling as the rocket took off from home, I put it down to nerves but I know now that I sensed the inevitable failure of this journey.'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: How we got here'
  };
  _BLUEPRINTS.INV_ITEMS.codec_b3 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: The Bookmaker] [Year: 4080]\r\nI still remember arrival day at the landing zone. Everyone was so excited, lined up at the windows of the deployment pod. It was quite a moving sight, even the children who were born a long the way who had never even seen a planet before; silent for the first time in years. Complete silence around the entire ship, only the engines thrusters could be heard. Until the thud. We\'d arrived.\r\n\r\nAt first nobody knew what to call our new home, some suggested fantastical names like Planet Perfect, Utopia and Natures Bounty. Ha. It still gives me a good chuckle. Imagine... Utopia!\r\n\r\nFor a long time the crew and new clones simply referred to the place as "The Desert", suggestions that drew any attention to this being anything other than miserable were quickly shot down by the majority of the now tired and cynical colony.\r\n\r\nAfter a while a few started to quip about it being the "Dead Desert". I can\'t argue.. Out of all the names we\'ve tried to attribute to this place... This one seems the most fitting.'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: The Dead Desert'
  };
  _BLUEPRINTS.INV_ITEMS.codec_b4 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: The Bookmaker] [Year: 4080]\r\nControl and power. That\'s all Sincorp wants. It\'s a tyrannical dictatorship in business form. For hundreds of years Sincorp performed world wide wars on several countries, companies and establishments in order to get control. We all saw it as the norm. It was so normal for companies to fund armies, ships and even tanks. Heck they probably manufactured most of them! Once you get to absolute power over one nations supply chain do you really exist as a "company"? Aren\'t you just another nation?\r\n\r\nMost don\'t even remember how Sincorp was formed. Some say it was based around social media, others say it was a hardware house that began in a garage. I personally never paid care to the history; Sincorp was normal to me. Every product I owned had a Sincorp logo on it. I remember when I was young and I had a SammyCorp teddy bear. I called him Sammy! One day my parents start talking about what Sammy represents. I was pretty confused and just wanted my Teddy back! I didn\'t know until I was much older this was all about another battle for Sincorp to take control over SammyCorps market share. It turns out at the time SammyCorps CEO was found signing of on the experimentation with gene splicing on animal hybrids, an activity recently outlawed by the very same SinCorp.'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: Battle of the balance books'
  };
  _BLUEPRINTS.INV_ITEMS.codec_b5 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: The Bookmaker] [Year: 4080]\r\nSo it would appear that we\'re not actually alone on this planet. Atleast not in the way of other creatures who can work together. A camp was reported to the far north with residents who didn\'t come from either our colony ship; nor our clone pods. No one has reported many details of who is setting up these camps, as most fear getting too close. But it\'s now certainly clear that we are not alone out here.\r\n\r\nI\'ve heard of others in the colony who have seen these figures. Some are calling them The Lokals. It\'d make sense, this is their planet after all.\r\n\r\nThe one thing I do hope is that their not hostile against our people. So far nothing has gone wrong, but there has been hearsay around about lokals killing wandering clones'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: The Lokals'
  };
  _BLUEPRINTS.INV_ITEMS.codec_b6 = {
    "sprite": 'item_codec',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: The Bookmaker] [Year: 4080]\r\nWhenever I think about the wildlife on this planet I don\'t know whether to laugh, cry or both. We thought it was great news when we saw the first creatures walking around the place. Food, skins and more; animalia and plant life can really boost a colonization efforts on an unknown planet.\r\n\r\nAnd reality sets in, why this planet is the Dead Desert. Sure you can maybe get a bit of meat off one of these creatures, if it doesn\'t kill you first! It feels like everything on this planet just wants to eat you.\r\n\r\nIt makes sense though. All these creatures who are destructive, well defended and hard to kill. This is a desert after all; resources are scarce and competition for survival is fierce. About the least dangerous thing on this planet is the desert tick and even they\'ve been known to kill a clone or two.'
    },
    "parent": 'ss_textitems_codecs',
    "name": 'Codec: Flora and Fauna, aka dont go outside'
  };
