  _BLUEPRINTS.INV_ITEMS.ss_brain_player_mk1 = {
    "sprite": 'brain_clone_1',
    "meta": {
      "weight": 1,
      "contextOptions": 'equipt',
      "slots": 'brain',
      "blockWidth": 3,
      "blockHeight": 3
    },
    "events": {
      "onEquipt": function (item, life) {
        life.data.brain = 'player_clone';
        life.data.faction = 'nomad';
        game.session.addPlayerPawn(life);
        life.sync();
        if (!game.mainHud) {
          game.mainHud = game.render.component('hud_main');
          game.render.aboveAll.addChild(game.mainHud);
        }
        life.addStatusFromClient('clone_needs', {
          duration: Infinity,
          source: 'gamestart'
        });
        life.craft = function () {
          var requires = this.recipe.require.split(",");
          var amounts = this.recipe.amount.split(",");
          if (requires.length !== amounts.length) {}
          let inventory = this.inventory.main;
          let resources = inventory.getResources();
          for (let i = 0; i < requires.length; i++) {
            var need = requires[i];
            var amount = amounts[i];
            if (!resources['ss_item_' + need]) {
              game.notify("Need " + amount + " " + need + "!");
              return false;
            }
            if (resources['ss_item_' + need] < parseInt(amount)) {
              game.notify("Need " + (resources['ss_item_' + need] - amount) + " more " + need + "!");
              return false;
            }
          }
          for (let i = 0; i < requires.length; i++) {
            var need = requires[i];
            var amount = amounts[i];
            inventory.removeResource(need, amount);
          }
          this.isCrafting = true;
          setTimeout(() => {
            this.isCrafting = false;
            let item = this.inventory.craft.addItem(new InventoryItem(this.recipe.crafts), true);
            this.xpAction('craftedInventoryItem', item);
          }, 2500);
        };
      },
      "onUnEquipt": function (item, life) {
        delete life.data.brain;
        game.session.removePlayerPawn(life);
        life.sync();
      }
    },
    "parent": 'ss_items_brains',
    "name": 'MK 1 Player Brain'
  };
