  _BLUEPRINTS.INV_ITEMS.codec_biology_sandtick = {
    "sprite": 'sprite_codec_biology',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Ira Barber] [Year: 4001]\r\nTicks, ticks, ticks, they\'re bloody everywhere! These horrible little critters make my skin crawl. Sure they\'re no threat to the colony but these parasites eat our crops, drink from our toilets and once I even woke up to one in my bed! I didn\'t know I was signing up for giant desert ticks sharing bunk with me!`n\r\nStill, as with all the creepy crawlies on this forsaken planet they do have a use to us. Their thick fur acts as a great insulator and can be further refined to make light clothing that is sturdy. It\'s a wonder how these freaks stay cool under the desert sun. I guess they must just insulate their bodies and use the fur as a sort-of barrier to the suns rays.'
    },
    "parent": 'ss_textitems_codecs_animal',
    "name": 'Biology: Sand Tick'
  };
  _BLUEPRINTS.INV_ITEMS.codec_biology_brainslug = {
    "sprite": 'sprite_codec_biology',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Ira Barber] [Year: 4071]\r\n"What a horrible creature; feeding on the brains of others. Pretty creepy. The first time I came across this disgusting goop it was attached to a poor clones head.\r\nThe clone seemed fine, he wasn\'t in pain even though he was bleeding from his crown."\r\n\r\nIn the end we held his head to a campfire to get the creep to leave. As soon as it came into contact with the flame it melted away into a small useless puddle of goop.'
    },
    "parent": 'ss_textitems_codecs_animal',
    "name": 'Biology: Brain Slug'
  };
  _BLUEPRINTS.INV_ITEMS.codec_biology_desspider = {
    "sprite": 'sprite_codec_biology',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Ira Barber] [Year: 4050]\r\nWhat a cute delight, these little spiders remind me of Earth\'s tarantulas, only bigger! I love their little eyes and dangly legs, sure they\'re a minor danger to the city but I think they\'re the cutest.\n\r\nMoreover the utility of these spiders web excites me, the web they emit can even stop a full grown adult clone. Amazing.\r\n\r\nIn the end we held his head to a campfire to get the creep to leave. As soon as it came into contact with the flame it melted away into a small useless puddle of goop.'
    },
    "parent": 'ss_textitems_codecs_animal',
    "name": 'Biology: Desert Spider'
  };
  _BLUEPRINTS.INV_ITEMS.codec_biology_putridmess = {
    "sprite": 'sprite_codec_biology',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Ira Barber] [Year: 4082]\r\nWhat the frack did I just witness. This will haunt my nightmares forever. What was that thing. 3 heads, no wait 4... 2 mouths, creepy ass legs. What the hell was that? We were in a science outpost when all of a sudden one of these disgusting things darts across the floor. I\'ve never seen Bob run so fast in my life, I\'m sure he was back in Landzo before we saw the damn thing move! I must have heard it cutting into several clones before finally purging the main hall and abandoning the building. God knows if it survived. Thank god we only lost the clones in there, not a single human life lost!\n\r\nI wouldn\'t even know where to start on the biology or utility of this creature. It\'s clearly some form of experiment gone wrong, but from where and by who? I have no idea. The creature appears to be extremely agile and dangerous. Maybe we could devise a trap sometime to capture one for study.'
    },
    "parent": 'ss_textitems_codecs_animal',
    "name": 'Biology: Putrid Mess'
  };
  _BLUEPRINTS.INV_ITEMS.codec_biology_mantis = {
    "sprite": 'sprite_codec_biology',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Ira Barber] [Year: 4071]\r\nCan you hear crickets? A little bit of flittering. Did your trash cans get knocked over in the night? I know what it is, it\'s the Red Mantis that prowl the desert!\r\n\r\nNot many people have seen one, most likely because anyone it does see normally ends up dead, but I saw one; I saw it scurrying away into the desert last night. It was red and shiny and had huge black eyes.'
    },
    "parent": 'ss_textitems_codecs_animal',
    "name": 'Biology: Mantis'
  };
  _BLUEPRINTS.INV_ITEMS.codec_biology_bloodbug = {
    "sprite": 'sprite_codec_biology',
    "meta": {
      "blockWidth": 1,
      "blockHeight": 1,
      "description": '[Author: Ira Barber] [Year: 4062]\r\nSo even a desert like this can be home to a creature as annoying as earths mosquitos, okay, I see how it is! These giant flyers are quick to attack and should absolutely be avoided!\r\n\r\nWe\'ve seen countless clones out in the desert drained of blood just baking in the desert suns waiting for the sand ticks to them finish off.'
    },
    "parent": 'ss_textitems_codecs_animal',
    "name": 'Biology: Blood bug'
  };
